void writeCMDTFT(uint8_t data){
		HAL_GPIO_WritePin(GPIOA, GPIO_PIN_4, 0); // CS
		HAL_GPIO_WritePin(GPIOA, GPIO_PIN_2, 0); //  = 0 => CMD
    HAL_SPI_Transmit(&hspi1, &data, 1, 1000);
    HAL_GPIO_WritePin(GPIOA, GPIO_PIN_4, 1); // CS
}

void writeDataTFT(uint8_t data){
    HAL_GPIO_WritePin(GPIOA, GPIO_PIN_4, 0);	// CS
		HAL_GPIO_WritePin(GPIOA, GPIO_PIN_2, 1); //  = 0 => Data
    HAL_SPI_Transmit(&hspi1, &data, 1, 1000);
    HAL_GPIO_WritePin(GPIOA, GPIO_PIN_4, 1);	// CS
}

void setPos(uint16_t x1, uint16_t y1, uint16_t x2, uint16_t y2){
    // --- (Column Address Set) ---
    writeCMDTFT(0x2A);          // CASET (Column Address Set)
    writeDataTFT(x1 >> 8);      
    writeDataTFT(x1);           
    writeDataTFT(x2 >> 8);      
    writeDataTFT(x2);           

    // --- (Row Address Set) ---
    writeCMDTFT(0x2B);          // 0x2B (RASET = Row Address Set)
    writeDataTFT(y1 >> 8);      
    writeDataTFT(y1);           
    writeDataTFT(y2 >> 8);      
    writeDataTFT(y2);           
}

